             contents:[
                 {parts:[{text:"Software Engineering Project Ideas"}]},
             ],
         },
        });
        console.log(
         response["data"]["candidates"][0]["content"]["parts"][0]["text"]
     );
     }
return(<div>
    <h1>Ask your Question to AI</h1>
    <button onClick={GenerateAnswer}>Generate Answer</button>
</div>)
}
